import React, { useEffect } from "react";
import Proposition from "../../component/Proposition/Proposition";
import axios from "axios";
import "./Main.scss";
import Carousel from "../../component/Carusel/Carousel";

const Main: React.FC = () => {

  useEffect(() => {
   fetch("http://:server/ws/p/:pkey/story")
    .then(r => r.json())
    .then(response => {
      console.log(response);
    })
    .catch(err => {
      console.error(err);
    });
  }, []);

  return (
    <div className="page">
      <Carousel />
      <Proposition />
    </div>
  );
};

export default Main;
